import React from 'react';
import ReturnSuCCess from './Success';
import BarLoader from 'react-spinners/BarLoader';
import { useNavigate } from 'react-router-dom';

// Return Main Success
export default function SuCCess() {

 const [loading, setLoading] = React.useState(true);
 const navigation = useNavigate();

 React.useEffect(() => {
  JSON.parse(window.localStorage.getItem('#62^^ts@&')) != true && navigation('/dash');

  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (
  <div>
   {loading && <div className='App-loading'></div>}
   {loading && <div className='App-Icon'>
    <BarLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />
   </div>}

   <ReturnSuCCess />
  </div>
 );
};
